import React from 'react';
import logo from './logo.svg';
import './Nav.css';

import {
  Link
} from 'react-router-dom';

const menus = [
  {id: 1, title: 'Lorem', link: '/'},
  {id: 2, title: 'Ipsum', link: '/ipsum'},
  {id: 3, title: 'Dolor', link: '/dolor'},
  {id: 4, title: 'Sit Amet', link: '/sit-amet'}
]

function NavLeft(props) {
  const menu = props.menus.map((menu) =>
    <Link key={menu.id}
      className="Nav-item"
      to={menu.link}>
      {menu.title}
    </Link>
  );

  return (
    <div className="Nav-left">
      {menu}
    </div>
  );
}

function NavRight() {
  return (
    <div className="Nav-right">
      <Link className="Nav-brand"
        to="/" >
        Lorem Ipsum
      </Link>
    </div>
  );
}

function Nav() {
  return (
    <nav className="Nav">
      <NavLeft menus={menus} />
      <NavRight />
    </nav>
  );
}

export default Nav;
